①혈중 콜레스테롤 개선·배변활동 원활에 도움을 줄 수 있음,차전자피식이섬유〕
①혈중 콜레스테롤 개선·배변활동 원활에 도움을 줄 수 있음', 'BASE_STANDARD': '① 성상 : 이미, 이취가 없고 고유의 향미가 있는 어두운 회갈색의 환② 식이섬유 : 표시량(5.5g / 16.5g) 의 80% 이상 ③ 총(-)-Hydroxycitric acid : 표시량(800㎎/16.5g)의 80~120%④ 납(㎎/㎏) : 1.0 이하 ⑤ 카드뮴(㎎/㎏) : 0.5 이하 ⑥ 총수은(㎎/㎏) : 0.4 이하 ⑦ 총비소(㎎/㎏) : 1.0 이하⑧ 붕해도 : 60분이내에 붕해되어야한다.⑨ 대장균군 : 음성'}
